import styled from 'styled-components';

export const Container = styled.div`
  width: 100%;
  height: 674px;
  background: #f4f4f4;
  display: flex;
  justify-content: center;
  padding: 29px 22px 57px 22px;
  h2 {
    font-weight: 600;
    font-size: 32px;
    line-height: 48px;
    color: #000000;
  }
  p {
    position: absolute;
    width: 684px;
    height: 60px;
    left: 281px;
    top: 1000px;

    font-family: Poppins;
    font-style: normal;
    font-weight: normal;
    font-size: 20px;
    line-height: 30px;
    text-align: center;

    color: #000000;
  }
`;
